import React from 'react'

class AddContact extends React.Component {
    render(){
        return (
            <div>
            <h1>Add Contact</h1>
            <form>
            <label>Name</label>
            <input type="text" name='name'/>
            <label>Email</label>
            <input type="text" name='email'/>
            <label>Phone</label>
            <input type="text" name='phone'/>
            <button>Add</button>
            </form>
            </div>
        )
    }
}

export default AddContact
